import React, { useReducer } from 'react';

const initialFormData = {
  fname: '',
  lname: '',
  qualification: '',
  subject: '',
  contact: '',
  email: '',
  password: '',
  uname: ''
};

const initialErrors = {};

const reducer = (state, action) => {
  switch (action.type) {
    case 'SET_FIELD':
      return {
        ...state,
        [action.field]: action.value
      };
    case 'SET_ERRORS':
      return {
        ...state,
        errors: action.errors
      };
    case 'RESET_FORM':
      return initialFormData;
    default:
      return state;
  }
};

const ExpertRegistration = () => {
  const [state, dispatch] = useReducer(reducer, {
    ...initialFormData,
    errors: initialErrors
  });

  const { errors } = state;

  const handleChange = (e) => {
    const { name, value } = e.target;
    dispatch({ type: 'SET_FIELD', field: name, value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    // Validation logic
    // ...
    // If validation fails, set errors using dispatch({ type: 'SET_ERRORS', errors: validationErrors });
    // Otherwise, proceed with form submission
  };

  const handleReset = () => {
    dispatch({ type: 'RESET_FORM' });
  };

  return (
    <div className="container">
      <div className="row justify-content-center mt-5">
        <div className="col-md-6">
          <div className="card shadow">
            <div className="card-body">
              <h2 className="card-title text-center mb-4"><b><u>Expert Registration</u></b></h2>
              <form onSubmit={handleSubmit}>
                {/* Form inputs */}
                {/* First Name */}
                <div className="mb-3 row">
                  <label htmlFor="fname" className="col-sm-4 col-form-label text-end">First Name:</label>
                  <div className="col-sm-8">
                    <input
                      type="text"
                      id="fname"
                      name="fname"
                      className={`form-control ${errors.fname && 'is-invalid'}`}
                      value={state.fname}
                      onChange={handleChange}
                      placeholder="Write First Name Here"
                    />
                    {errors.fname && <div className="invalid-feedback">{errors.fname}</div>}
                  </div>
                </div>
                {/* Last Name */}
                <div className="mb-3 row">
                  <label htmlFor="lname" className="col-sm-4 col-form-label text-end">Last Name:</label>
                  <div className="col-sm-8">
                    <input
                      type="text"
                      id="lname"
                      name="lname"
                      className={`form-control ${errors.lname && 'is-invalid'}`}
                      value={state.lname}
                      onChange={handleChange}
                      placeholder="Write Last Name Here"
                    />
                    {errors.lname && <div className="invalid-feedback">{errors.lname}</div>}
                  </div>
                </div>
                {/* Qualification */}
                {/* Add similar code for other fields */}
                {/* Uname */}
                <div className="mb-3 row">
                  <label htmlFor="uname" className="col-sm-4 col-form-label text-end">Username:</label>
                  <div className="col-sm-8">
                    <input
                      type="text"
                      id="uname"
                      name="uname"
                      className={`form-control ${errors.uname && 'is-invalid'}`}
                      value={state.uname}
                      onChange={handleChange}
                      placeholder="Write Username Here"
                    />
                    {errors.uname && <div className="invalid-feedback">{errors.uname}</div>}
                  </div>
                </div>
                {/* Form buttons */}
                <div className="text-center">
                  <button type="submit" className="btn btn-primary">Add Expert</button>
                  <button type="button" className="btn btn-primary" onClick={handleReset}>Reset</button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ExpertRegistration;
